import React from 'react'
// import { BrowserRouter as Route, Switch } from 'react-router-dom'
import CreateUser from './CreateUser'
import Header from './Header'
import ListUser from './ListUser'

function Routes() {
    return (
        <React.Fragment>

            <Header/>

          <ListUser/>
          <CreateUser/>

        </React.Fragment>
    )
}

export default Routes
